function injectBottomLeftTextHeader(text) {
    const newElement = document.createElement("div");

    newElement.textContent = text;

    newElement.style.position = "fixed";
    newElement.style.bottom = "0px";
    newElement.style.left = "0px";
    newElement.style.padding = "5px 10px";
    newElement.style.backgroundColor = "#333";
    newElement.style.color = "white";
    newElement.style.zIndex = "1";
    newElement.style.fontSize = "25px";
    newElement.style.borderRadius = "5px";
    newElement.style.fontFamily = "Minecraftia";
    newElement.style.userSelect = "none";
    newElement.style.cursor = "default";
    newElement.style.display = "inline-block";
    newElement.style.transform = "translateY(0px)";
    newElement.style.transition = "transform 0.2s ease-in-out, filter 0.2s ease-in-out";

    newElement.addEventListener("mouseenter", function() {
        newElement.style.transform = "translateY(5px)";
        newElement.style.filter = "brightness(85%)";
    });

    newElement.addEventListener("mouseleave", function() {
        newElement.style.transform = "translateY(0px)";
        newElement.style.filter = "brightness(100%)";
    });

    setTimeout(() => {
        newElement.style.display = "none";
        this.remove();
    }, 2000);

    document.body.appendChild(newElement);
}

